import React from 'react';
import NavBar from './components/navbar';
import './App.css';
import Counters from './components/counters';

function App() {
  return (
    <React.Fragment>
    <NavBar />
    <main className="container"></main>
    <Counters />
    </React.Fragment>
  );
}

export default App;
